import { TraceType } from '../../node/utils/index.js';
export const isCompletionStartTrace = (trace) => trace.type === TraceType.COMPLETION_START;
export const isCompletionStartTraceSpeak = (trace) => trace.payload.type === TraceType.SPEAK;
export const isCompletionStartTraceText = (trace) => trace.payload.type === TraceType.TEXT;
